import axios from "axios";

// 책 정보 불러오기
export async function getLibraryAPI(ISBN:number, REGION_CODE:number) {
  try {
    const { data } = await axios({
      method: "GET",
      url: `${process.env.REACT_APP_LIBRARY_API_URL}/libSrchByBook?authKey=$P발급받은키]&isbn=${ISBN}&region=${REGION_CODE}&format=json`,
    });
    return data;
  } catch (e) {
    console.log(e);
  }
}
